export const baseUrl = 'http://localhost:3000/api/v1'

export const colors = {
  1: {
    slateGrey: '#747C92',
    outerSpace: '#424c55',
    moonstoneBlue: '#75ABBC',
    isabelline: '#F5EDF0',
    floralWhite: '#FFF8F0'
  },
  2: {
    midnightGreen: '#114B5F',
    antiFlashWhite: 'rgba(232, 241, 242, 1)',
    bone: 'rgba(226, 212, 183, 1)',
    rosyBrown: '#CC978E',
    lavenderGrey: '#C5C3C6'
  },
  3: {
    peach: 'rgba(247, 197, 159, 1)',
    moccasin: 'rgba(252, 234, 222, 1)',
    tiffannyBlue: 'rgba(0, 182, 188, 1)',
    tropicalRainForest: 'rgba(0, 99, 93, 1)',
    babyPowder: 'rgba(253, 255, 252, 1)'
  }
}

export const colorPalletes = {
  1: {
    primaryColor: colors[1].outerSpace,
    secondaryColor: colors[1].slateGrey,
    tertiaryColor: colors[1].moonstoneBlue,
    quaternaryColor: colors[1].isabelline,
    quinaryColor: colors[1].floralWhite
  },
  2: {
    primaryColor: colors[2].midnightGreen,
    secondaryColor: colors[2].rosyBrown,
    tertiaryColor: colors[2].bone,
    quaternaryColor: colors[2].lavenderGrey,
    quinaryColor: colors[2].antiFlashWhite
  },
  3: {
    primaryColor: colors[3].peach,
    secondaryColor: colors[3].moccasin,
    tertiaryColor: colors[3].tiffannyBlue,
    quaternaryColor: colors[3].tropicalRainForest,
    quinaryColor: colors[3].babyPowder
  }
}

export const themeColors = {
  primaryColor: colorPalletes[2].primaryColor,
  secondaryColor: colorPalletes[2].secondaryColor,
  tertiaryColor: colorPalletes[2].tertiaryColor,
  quaternaryColor: colorPalletes[2].quaternaryColor,
  quinaryColor: colorPalletes[2].quinaryColor
}

export const screenSizes = {
  screenSm: 320,
  screenMd: 720,
  screenLg: 1266
}

export const transitions = {
  standardTiming: '0.225s',
  standardCubic: 'cubic-bezier(0.645, 0.045, 0.355, 1)'
}
